import { Box, Typography } from "@mui/material";
import React from "react";
import EditIcon from "../assets/location/EditIcon";
import AppBarTop from "../components/AppBarTop";
import { PADDING } from "../constants/Padding";
import { THEME } from "../constants/Theme";
import { useNavigate } from "react-router-dom";
import Beras from "../assets/product/Beras.png";


function Checkout() {
  const [mainLoc, setMainLoc] = React.useState({1:true});
  const navigate = useNavigate()

  const handleBtn = btnId => e => {
    e.preventDefault();
    setMainLoc(false)
    setMainLoc(state => ({
      ...state,
      [btnId]: !setMainLoc[true]
    }));
    console.log(mainLoc)
  };

  return (
    <Box
      sx={{
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start",
        alignItems: "center",
      }}
    >
      <AppBarTop text={"Keranjang"} line />

      <Box sx={{display: 'flex', justifyContent: 'space-between', alignItems: 'center', width: PADDING, mt: '16px'}}>
        <Box sx={{display: 'flex', alignItems: 'center'}}>
            <Box sx={{borderRadius: '50%', width: '24px', height: '24px', background: '#F5F5F5'}}/>
            <Typography sx={{fontSize: '12px', fontWeight: 600, ml: '16px'}}>Pilih semua produk</Typography>
        </Box>
        <Typography sx={{fontSize: '10px', color: THEME.GREEN_PRIMARY}}>Hapus</Typography>
      </Box>

      <Box sx={{height: '1px', width: PADDING, background: "#F5F5F5", mt: '11px'}}/>

      <Box sx={{display: 'flex', alignItems: 'center', width: PADDING, mt: '16px'}}>

        <img src={Beras} width="53px" height={"42px"}/>
      </Box>
    </Box>
  );
}

export default Checkout;
